configure:
  commands:
    end:
      new_state: execute
    interface Gi1/0/5: "interface Gi1/0/5\r\n"
    line console 0:
      new_state: configure_line
    no l2protocol-tunnel drop-threshold point-to-point lacp: "no l2protocol-tunnel\
      \ drop-threshold point-to-poin\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\
      \b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b$ol-tunnel drop-threshold\
      \ point-to-point         \b\b\b\b\b\b\b\b\b lacp\r\n"
    no logging console: ''
  prompt: stack3-nyquist-1(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: stack3-nyquist-1(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: stack3-nyquist-1#
